import {  Link, generatePath } from "react-router-dom";

export default function gallerycasas({casas}){
    return(
        <Link to ={generatePath("/CasasDetails/:id",{id: casas.id})}>
            <div className="Galeria">
                <figure key={casas.id}>
                    <h3>{casas.title}</h3>
                    <img src={casas.image} alt={casas.image}/>


                </figure>
            </div>
        </Link>
    )
}
